import React, { useState } from "react";
import "./Dashboard.css";
import CreateFolderModal from "./CreateFolderModal";
import CreateFormModal from "./CreateFormModal";

const Dashboard = () => {
  const [isModalOpen, setIsModalOpen] = useState(false);
  const [modalType, setModalType] = useState(null);
  const [isLightTheme, setIsLightTheme] = useState(false);
  const [isDropdownOpen, setIsDropdownOpen] = useState(false);
  const [folders, setFolders] = useState([]); // State for folders

  // Function to open modal with specified type
  const openModal = (type) => {
    setModalType(type);
    setIsModalOpen(true);
  };

  // Function to close modal
  const closeModal = () => {
    setIsModalOpen(false);
    setModalType(null);
  };

  // Function to handle folder creation
  const handleCreateFolder = (folderName) => {
    if (folderName.trim()) {
      setFolders([...folders, folderName.trim()]);
    }
    closeModal();
  };

  // Toggle theme
  const toggleTheme = () => {
    setIsLightTheme((prevState) => !prevState);
  };

  // Toggle dropdown menu
  const toggleDropdown = () => {
    setIsDropdownOpen((prevState) => !prevState);
  };

  return (
    <div className={`dashboard-container ${isLightTheme ? "light" : "dark"}`}>
      {/* Navbar */}
    
<div className="contain">
<nav className="navbar">
        <div className="workspace-container">
          <button className="workspace-button" onClick={toggleDropdown}>
            <span>Dewank Rastogi's workspace</span>
            <img className="dropdown-icon" src="drop.png" alt="Dropdown Icon" />
          </button>

          {/* Dropdown menu */}
          {isDropdownOpen && (
            <div className="dropdown-menu">
              <button className="dropdown-item">Settings</button>
              <button className="dropdown-item logout">Log Out</button>
            </div>
          )}
        </div>

        <div className="theme-toggle">
          <span>Light</span>
          <label className="switch">
            <input
              type="checkbox"
              checked={!isLightTheme}
              onChange={toggleTheme}
            />
            <span className="slider"></span>
          </label>
          <span>Dark</span>
        </div>
        <button className="share-button">Share</button>
      </nav>

      <div className="dashboard-content">
  <div className="create-folder-container">
    <button className="create-folder" onClick={() => openModal("folder")}>
      <img src="folder.png" className="folder" alt="Folder" />
      Create a folder
    </button>
  

  {/* Create Typebot button */}
  <button className="create-typebot" onClick={() => openModal("form")}>
    <p>
      <span className="plus">+</span> <br />
      Create a typebot
    </p>
  </button>
</div>

<div className="folder-list">
      {folders.map((folder, index) => (
        <div key={index} className="folder-item">
          {folder}
        <button className="delete-button"><img src="del.png"></img></button></div>
      ))}
    </div>
  </div>

</div>

      {/* Conditional rendering of modals */}
      {isModalOpen && modalType === "folder" && (
        <CreateFolderModal
          closeModal={closeModal}
          isLightTheme={isLightTheme}
          onCreateFolder={handleCreateFolder}
        />
      )}
      {isModalOpen && modalType === "form" && (
        <CreateFormModal closeModal={closeModal} isLightTheme={isLightTheme} />
      )}
    </div>
  );
};

export default Dashboard;
